import React from 'react';
import './App.css';
import { GoogleMap } from "google-map-react"

function Map() {
  return (
    <GoogleMap defaultZoom={10} defaultCenter={{lat: 45.5, lng: -75}}/>
  )
}

function App() {
  return (
    <div>map here</div>
  );
}

export default App;
